	add("unicorn", "{\"term\":\"unicorn\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"Image:DomenichinounicornPalFarnese.jpg|thumb|right|250px|Unicorn with a maiden, fresco in Palazzo Farnese, Rome, probably by Domenichino, ca 1602 (1)From Anglo-norman \u0027unicorne\u0027 Old french (842-ca. 1400) \u0027unicorne\u0027 and their source, Latin {{m|la|ūnicornis}}, from \u0027unus\u0027 () + \u0027cornu\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mythical beast resembling a horse with a single, straight, spiraled horn projecting from its forehead\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A heraldic representation of such a beast used as a charge or as a supporter; as in the arms of Great Britain and of Scotland\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In various Bible translations, used to render the Latin or (representing Hebrew ); a reem or wild ox\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"God brought him forth out of Egypt; he hath as it were the strength of an \u0027\u0027unicorn\u0027\u0027: he shall eat up the nations his enemies, and shall break their bones, and pierce them through with his arrows\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any large beetle having a horn-like prominence on the head or prothorax\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The larva of a unicorn moth\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The kamichi, or unicorn bird\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A howitzer\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A startup company whose valuation has exceeded one billion U.S. dollars\", \"priority\":9}]}, \"synonyms\":{}}");

