	add("uniformitarianism", "{\"term\":\"uniformitarianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|uniformitarian|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The scientific principle that natural processes operated in the past in the same way and at the same rates that they operate today\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Earth\u0027, Folio Society 2011, p. 20\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There has been much puffy stuff written about whether Lyell\u0027s \u0027\u0027uniformitarianism\u0027\u0027 permitted variations in intensity of causes, or whether he applied his logic in a consistent way, and whether he assumed indefinite stretches of geological time\", \"priority\":3}]}, \"synonyms\":{}}");

	add("uniformity", "{\"term\":\"uniformity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027uniformité\u0027 from \u0027uniformitas\u0027 Surface etymology is {{suffix|uniform|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being uniform, alike and lacking diversity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The absence of alternativism\", \"priority\":2}]}, \"synonyms\":{}}");

