	add("unisus", "{\"term\":\"unisus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|unicorn|Pegasus|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A winged unicorn\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"location \u003d Central Milton Keynes isbn \u003d 9781425949549 ol \u003d 8534527M page \u003d 267 pageurl \u003d http://books.google.com/books?id\u003d9cgM5o4e4ygC\u0026amp;pg\u003dPA267\u0026amp;dq\u003dunisus passage \u003d The beauty of the \u0027\u0027Unisus\u0027\u0027 was simply extraordinary. Its silver-feathered wings stretched across the room, fifteen feet in length. Its glorious, glowing white fur was so pure that it would be invisible in the snow\", \"priority\":2}]}, \"synonyms\":{\"list\":[{\"text\":\"pegacorn\", \"synonymQualifier\":\"INFORMAL\"},{\"text\":\"unipeg\", \"synonymQualifier\":\"INFORMAL\"}]}}");

	add("unitard", "{\"term\":\"unitard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A blend of \u0027uni-\u0027 + \u0027leotard\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A skin-tight garment covering the torso and the legs, sometimes the arms and feet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Leslie Norton, w:Frederic Frederic Franklin, \u0027Frederic Franklin: A Biography of the Ballet Star\u0027, [http://books.google.com.au/books?id\u003dwecvfSWQKJsC\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22unitard%22%7C%22unitards%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWj52UerUCaakiQK6j4HwBA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22unitard%22%7C%22unitards%22\u0026amp;f\u003dfalse page 46\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"While Lincoln Kirstein noted that the unitards did show clearly the dancers\u0027 lines, he too found them distracting: \u0026quot;Union-suit tights are hard to make look neat, but the line of undergarments shining through continually destroyed the line.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Scott Speck, Evelyn Cisneros, \u0027Ballet for Dummies\u0027, [http://books.google.com.au/books?id\u003d-1L_M65oWm8C\u0026amp;pg\u003dPT41\u0026amp;dq\u003d%22unitard%22%7C%22unitards%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWj52UerUCaakiQK6j4HwBA\u0026amp;redir_esc\u003dy unnumbered page\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027unitard\u0027\u0027 consists of a \u0027leotard\u0027 (a sort of stretchy one-piece bathing suit) attached to a pair of tights, which completely cover the legs. The \u0027\u0027unitard\u0027\u0027 can be worn by anyone — men and women, boys, girls, and extraordinarily graceful household pets\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Jodi Lundgren, \u0027Leap\u0027, [http://books.google.com.au/books?id\u003dp88s-la_sTsC\u0026amp;pg\u003dPA73\u0026amp;dq\u003d%22unitard%22%7C%22unitards%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dWj52UerUCaakiQK6j4HwBA\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22unitard%22%7C%22unitards%22\u0026amp;f\u003dfalse page 73\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Backstage (that is, in the high school locker room) before the show, all the other senior girls were pulling on their red \u0027\u0027unitards\u0027\u0027 for the jazz piece\", \"priority\":9}]}, \"synonyms\":{}}");

