	add("university", "{\"term\":\"university\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0026quot;institution of higher learning,\u0026quot; \u0026quot;body of persons constituting a university,\u0026quot; from Anglo-norman \u0027université\u0027 from Old french (842-ca. 1400) \u0027universitei\u0027 () from stem of \u0027universitas\u0027 in juridical and \u0026quot;A number of persons associated into one body, a society, company, community, guild, corporation, etc.,\u0026quot; in Latin \u0026quot;the whole, aggregate,\u0026quot; from \u0027universus\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Institution of higher education (typically accepting students from the age of about 17 or 18, depending on country, but in some exceptional cases able to take younger students) where subjects are studied and researched in depth and degrees are offered\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1661\u0027\u0027, \u0027[http://archive.org/stream/a615775104worduoft/a615775104worduoft_djvu.txt The Life of the most learned, reverend and pious Dr. H. Hammond\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"During the whole time of his abode in the \u0027\u0027university\u0027\u0027 he generally spent thirteen hours of the day in study; by which assiduity besides an exact dispatch of the whole course of philosophy, he read over in a manner all classic authors that are extan\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/http://www.economist.com/news/business/21582001-army-new-online-courses-scaring-wits-out-traditional-universities-can-they The attack of the passage\u003dSince the launch early last year of\u0026amp;nbsp;[\u0026amp;hellip;] two Silicon Valley start-ups offering free education through MOOCs, massive open online courses, the ivory towers of academia have been shaken to their foundations. \u0027\u0027University\u0027\u0027 brands built in some cases over centuries have been forced to contemplate the possibility that information technology will rapidly make their existing business model obsolete\", \"priority\":4}]}, \"synonyms\":{}}");

